import React from 'react';

const Settings = () => {
  return (
    <div style={{ padding: '2rem' }}>
      <h1>الإعدادات</h1>
      <div className="alert alert-info">
        <p>صفحة الإعدادات قيد التطوير</p>
        <p>سيتم إضافة إعدادات النظام قريباً</p>
      </div>
    </div>
  );
};

export default Settings;
